import React, { Component } from "react";
import axios from "axios";
import './LoginUser.css'
export default class LoginUser extends Component {
    state = {
        nickname: '',
        password: ''
    }
    getLogin = async e => {
        e.preventDefault();
        const res = await axios.post(process.env.REACT_APP_HOSTNAME + '/users/login', {
            nickname: this.state.nickname,
            password: this.state.password
        });
        console.log(res)
    }

    render() {
        return (
            <div>
                <div className="title">
                    <h1>Transportes App</h1>
                    <img src={process.env.REACT_APP_PUBLIC_URL + '/transporteEstadosImg/bien.png'} alt="logo"/>
                </div>
                <form className="container" onSubmit={this.getLogin}>
                    <div >
                        <h3 className="log">Iniciar Sesi√≥n</h3>
                    </div>
                    <div className="form-outline mb-4">
                        <input type="text" className="form-control" />
                        <label className="form-label">Nickname</label>
                    </div>
                    <div className="form-outline mb-4">
                        <input type="password" className="form-control" />
                        <label className="form-label">Password</label>
                    </div>

                    <button type="submit" className="btn btn-primary btn-block mb-4">Sign in</button>

                    <div class="text-center">
                        <p>Not a member? <a href="#!">Register</a></p>
                    </div>
                </form>
            </div>
        );
    }
}
